import { Router } from 'express'
const router = Router();
// DB Connection
import { connect } from '../database'

function escapeRegExp(string) {
    return string.replace(/[.*+?^${}()|[\]\\]/g, '\\$&'); // $& means the whole matched string
  }

router.get('/players', async (req, res) => {
    const db = await connect();

    const PAGE = req.query.page || 1
    const ORDER = (req.query.order == 'asc') || !req.query.order ? 1 : -1
    const SEARCH = req.query.search|| ''
    const PAGE_SIZE = 10;
    console.log(SEARCH)

    const query = db.collection('player')
    .find(SEARCH!==''? { 'name' : { '$regex': escapeRegExp(SEARCH) } }: {})
    .skip((PAGE - 1) * PAGE_SIZE)
    .limit(PAGE_SIZE)
    .sort({name: ORDER})

    const players = await query.toArray()
    const totalPlayers = await query.count()

    const response = {
      Page: `${PAGE}`,
      totalPages: totalPlayers > PAGE_SIZE ? Math.floor(totalPlayers/PAGE_SIZE) : 1,
      Items: players.length > PAGE_SIZE ? PAGE_SIZE : players.length,
      totalItems: totalPlayers,
      Players: players
    }

    res.send(response);
});

router.get('/players/:id', async (req, res) => {
  const db = await connect();

  const query = await db.collection('player').findOne({'_id': req.query.id})
  console.log(query)

  res.json(query);
});

router.post('/teams', async (req, res) => {
  const db = await connect();

  const SEARCH = req.body.team || ''
  const PAGE = req.body.page || 1
  const PAGE_SIZE = 10;
  const query = db.collection('player')
    .find(SEARCH!==''? { 'club' : { '$regex': escapeRegExp(SEARCH) } }: {})
    .skip((PAGE - 1) * PAGE_SIZE)
    .limit(PAGE_SIZE)

    const players = await query.toArray()
    const totalPlayers = await query.count()

    const response = {
      Page: `${PAGE}`,
      totalPages: totalPlayers > PAGE_SIZE ? Math.floor(totalPlayers/PAGE_SIZE) : 1,
      Items: players.length > PAGE_SIZE ? PAGE_SIZE : players.length,
      totalItems: totalPlayers,
      Players: players
    }

    res.send(response);
});

export default router;

