import MongoClient from 'mongodb'
import fetch from "node-fetch";

export const getPlayers = async() => {
    try {
        let db = await connect()
        let res = await fetch('https://www.easports.com/fifa/ultimate-team/api/fut/item')
        let data = await res.json()
        await db.collection('player').insert(transformPlayers(data.items));

        for (let i = 2; i<data.totalPages; i++){
            res = await fetch(`https://www.easports.com/fifa/ultimate-team/api/fut/item?page=${i}`)
            data = await res.json()
            await db.collection('player').insert(transformPlayers(data.items));
        }


    }catch (e) {
        console.log(e)
    }

}

const transformPlayers = (items) => {
    const players = []
    items.forEach((player) => {
        players.push({
            name: `${player.firstName} ${player.lastName}`,
            nation: player.nation.name,
            club: player.club.name,
            position: player.position
        })
    })
    return players
}

export async function connect() {
    try {
        const client = await MongoClient.connect('mongodb://localhost:27017/', {useNewUrlParser: true});
        const db = client.db('nodejs-restapi');
        if(db.collection('player')) db.collection('player').createIndex({name: "text"})
        return db;
    } catch(e) {
        console.log(e);
    }
};
